css:
.github-StagingView {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-group {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-StagingView-header {
  display: flex;
  align-items: center;
  padding: 0 0 0 1rem;
  font-weight: 600;
  border-top: 1px solid #20252a;
  border-bottom: 1px solid #20252a;
}
.github-UnstagedChanges > .github-StagingView-header {
  border-top: none;
}
.github-StagingView-header .icon {
  text-align: center;
}
.github-StagingView-header .icon:before {
  color: #798c9d;
  margin-right: 0.83333333rem;
  vertical-align: middle;
}
.github-StagingView-headerButton {
  height: 2.5em;
  border: none;
  padding: 0 1rem;
  font-weight: normal;
  border-left: 1px solid #20252a;
  white-space: nowrap;
  background: none;
  cursor: default;
}
.github-StagingView-headerButton:disabled {
  color: #798c9d;
}
.github-StagingView-headerButton:active {
  background-color: #2d353b;
}
.github-StagingView-headerButton.icon:before {
  margin-right: 0;
  font-size: 1em;
  text-align: left;
}
.github-StagingView-headerButton--fullWidth {
  border-left: none;
  border-bottom: 1px solid #20252a;
}
.github-StagingView-headerButton--iconOnly:before {
  width: auto;
}
.github-StagingView-title {
  flex: 1;
  margin-right: 1rem;
  line-height: 2.5em;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
}
.github-StagingView-list {
  flex: 1 1 0;
  overflow-x: auto;
}
.github-StagingView-group-truncatedMsg {
  padding: 0.5rem 1rem;
}
.github-StagingView-group.is-focused .is-selected {
  color: #f9fafb;
  background: #2d353b;
}
.github-StagingView:focus .github-StagingView-group.is-focused .is-selected {
  color: #ffffff;
  background: #3a444d;
}
